import React from 'react';

const Users = ({users}) =>(
    <div onClick={()=>{}}>
        <div>{users.avatar_url}</div>
        <div>
            <div>{users.login}</div>
            <div>{users.type}</div>
            <div>{users.score}</div>
        </div>
    </div>
)

export default Users;
